import { loadDashBoardRequest, loadDashBoardResponse } from './slice';

export function loadDashboard() {
    return async (dispatch, getState) => {
        dispatch(loadDashBoardRequest());
        const userName = getState().login.data.userName;
        setTimeout(() => {
            dispatch(loadDashBoardResponse([{
                dashboardName: 'Dashboard 1',
                userName: userName,
            },{
                dashboardName: 'Dashboard 2',
                userName: userName,
            },{
                dashboardName: 'Dashboard 3',
                userName: userName,
            }]));
        }, 2000);
    };
}
